// let p = {
//   'content': "Profile_content__29auf",
//   'space': "Profile_space__2ASU1",
//   'astronaut': "Profile_astronaut__2VTYk",
// };

const Profile = () => {
  return (
    <div className={p.content}>
      <img
        className={p.space}
        src="https://avatanplus.com/files/resources/original/5cb1eb4d3d21516a16ff25c2.jpg"
      ></img>
      <div>
        <img
          className={p.ast}
          src="http://bm.img.com.ua/berlin/storage/orig/2/e3/c7eb255f1c240407c9a6a205378a2e32.png"
        ></img>
        <div>text</div>
      </div>
      <div>input</div>
    </div>
  );
};

export default Profile;
